import React from 'react';
import './welcome.css'; 

const Welcome = () => {
  return (
    <div>
        <div>
            <h1>Welcome to <span>Food Hub</span></h1>
            <p>Your favourite foods delivered fast at your door.</p>
        </div>
        <div>sign-in with</div>
        <div>google <span>facebook</span></div>
        <div>start with </div>
   
    </div>
  );
};

export default Welcome;
